 const[state,setState]=useState({
    title:"Unlock Screen",
    url:""});

    const [switchState,setSwitchState]=useState(true);

  function handleValue(e){
    console.log(e.target.value);
    if(e.target.value >= 99)
    setState(false);
    else
    setState(true);

    console.log(state);
  }

    return(
        (<div className="locked-screen">
         <h1>{state.title}</h1>
      {(switchState) ? <input className="test" style={{background:`${state.url} no-repeat`}} type="range"  onInput={handleValue} /> : <AiFillUnlock/>}
     </div>) )
}

export default SlideToUnlock;
